import { type } from "@testing-library/user-event/dist/type";
import React from "react";

const Entry = () => {
    return(
        <div className="entry">
     <label>Name:</label> 
     <input type="text"/>
     <label>FEES:</label>
     <input type="text"/>
     <button>SAVE</button>
     </div>
    );
}

export default Entry;
